// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "../../shared/interfaces/IKAP721/IKAP721SDK.sol";
import "./KAP721.sol";
import "../../shared/abstracts/AccessControllerSDK.sol";

contract AtomicKAP721 is KAP721, IKAP721SDK, AccessControllerSDK {
    event MintWithMetadata(
        address indexed operator,
        string _tokenURI,
        uint256 _tokenId
    );
    event MintWithMetadataBatch(
        address indexed operator,
        string[] _tokenURIs,
        uint256[] _tokenIds
    );

    ///////////////////////////////////////////////////////////////////////////////////////

    modifier onlyOwnerOrHolder(uint256 _tokenId) {
        require(
            msg.sender == owner() || msg.sender == ownerOf(_tokenId),
            "KAP721SDK: restricted only super admin or owner or holder"
        );
        _;
    }

    modifier onlyOwnerOrCommittee() {
        require(
            msg.sender == owner() || msg.sender == committee,
            "KAP721SDK: Restricted only owner or committee"
        );
        _;
    }

    ///////////////////////////////////////////////////////////////////////////////////////

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _baseURI,
        address _kyc,
        address _committee,
        address _transferRouter,
        address _executorEnv,
        uint256 _acceptedKycLevel,
        string memory _envId
    )
        KAP721(
            _name,
            _symbol,
            _baseURI,
            _kyc,
            _committee,
            _transferRouter,
            _acceptedKycLevel
        )
        AccessControllerSDK(_executorEnv, _envId)
    {}

    ///////////////////////////////////////////////////////////////////////////////////////

    function exists(uint256 _tokenId) external view returns (bool) {
        return _exists(_tokenId);
    }

    ///////////////////////////////////////////////////////////////////////////////////////

    function setExecutorEnv(address _executorEnv) external onlyCommittee {
        require(
            address(executorEnv) != _executorEnv,
            "Authorization: Same as old admin address"
        );
        emit ExecutorEnvSet(address(executorEnv), _executorEnv, msg.sender);
        executorEnv = IExecutorEnv(_executorEnv);
    }

    function setTokenURI(
        uint256 _tokenId,
        string calldata _tokenURI
    ) external onlyOwnerOrCommittee {
        _setTokenURI(_tokenId, _tokenURI);
    }

    function setBaseURI(
        string calldata _baseURI
    ) external onlyOwnerOrCommittee {
        _setBaseURI(_baseURI);
    }

    function pause() external onlyOwnerOrCommittee {
        _pause();
    }

    function unpause() external onlyOwnerOrCommittee {
        _unpause();
    }

    ///////////////////////////////////////////////////////////////////////////////////////

    function approveBySDK(
        address _operator,
        uint256 _tokenId
    ) external override onlyExecutor returns (bool) {
        address _owner = KAP721.ownerOf(_tokenId);
        require(_operator != _owner, "KAP721SDK: Approval to current owner");

        require(
            kyc.kycsLevel(_owner) >= acceptedKycLevel &&
                kyc.kycsLevel(_operator) >= acceptedKycLevel,
            "KAP721SDK: Owner or operator address is not a KYC user"
        );

        _approve(_operator, _tokenId);
        return true;
    }

    function setApprovalForAllBySDK(
        address _owner,
        address _operator,
        bool _approved
    ) external override onlyExecutor returns (bool) {
        require(_operator != _owner, "KAP721SDK: Approve to caller");

        require(
            kyc.kycsLevel(_owner) >= acceptedKycLevel &&
                kyc.kycsLevel(_operator) >= acceptedKycLevel,
            "KAP721SDK: Owner or operator address is not a KYC user"
        );

        _setApprovalForAll(_owner, _operator, _approved);
        return true;
    }

    function transferFromBySDK(
        address _sender,
        address _recipient,
        uint256 _tokenId
    ) external override onlyExecutor returns (bool) {
        require(
            kyc.kycsLevel(_sender) > acceptedKycLevel &&
                kyc.kycsLevel(_recipient) > acceptedKycLevel,
            "KAP721SDK: Only internal purpose"
        );

        _transfer(_sender, _recipient, _tokenId);

        return true;
    }

    ///////////////////////////////////////////////////////////////////////////////////////

    function mint(
        address _to,
        uint256 _tokenId
    ) external onlyOwner whenNotPaused {
        _mint(_to, _tokenId);
    }

    function burn(
        uint256 _tokenId
    ) external onlyOwnerOrHolder(_tokenId) whenNotPaused {
        _burn(_tokenId);
    }

    function mintWithMetadata(
        address _to,
        string memory _tokenURI,
        uint256 _tokenId
    ) external onlyOwner whenNotPaused {
        _mintWithMetadata(_to, _tokenURI, _tokenId);

        emit MintWithMetadata(_to, _tokenURI, _tokenId);
    }

    function mintWithMetadataBatch(
        address _to,
        string[] memory _tokenURIs,
        uint256[] memory _tokenIds
    ) external onlyOwner whenNotPaused {
        require(
            _tokenURIs.length == _tokenIds.length,
            "KAP721SDK: Need all input in same length"
        );
        for (uint256 i = 0; i < _tokenIds.length; i++) {
            _mintWithMetadata(_to, _tokenURIs[i], _tokenIds[i]);
        }

        emit MintWithMetadataBatch(_to, _tokenURIs, _tokenIds);
    }

    function _mintWithMetadata(
        address _to,
        string memory _tokenURI,
        uint256 _tokenId
    ) internal {
        _mint(_to, _tokenId);
        _setTokenURI(_tokenId, _tokenURI);
    }
}

